North Star

Technology Documentary hosted by Barbara Budd, published by Discovery Channel broadcasted as part of DC Mighty Ships series in 2011 - English narration


Information
------------------------------

The North Star is a roll-on/roll-off ship that delivers cargo from Tacoma, Washington to Anchorage, Alaksa within 72 hours through one of the most dangerous shipping routes.

